import React from "react";
import { FaSearch } from "react-icons/fa"; // Importing a search icon

function AssetSearchBar() { // Capitalized component name
  return (
    <div style={{ width: "335px", height: "44px", position: "absolute", top: "1176px", left: "1158px", gap: "0px", borderRadius: "6px 0px 0px 0px", border: "1px solid transparent", borderTop: "1px solid #000", opacity: 1 }}>

<FaSearch style={{ display: "flex", width: "24.484px", height: "22px", justifyContent: "center", alignItems: "center", flexShrink: 0, marginRight: "8px", color: "#ccc" }} />
<input
        type="text"
        placeholder="Search for Assets"
        style={{ 
            color:"#787486",
            fontFamily: "Inter", // Corrected from 'font-family'
            fontSize: "14px",    // Corrected from 'font-size'
            fontStyle: "normal", // Corrected from 'font-style'
            fontWeight: "400",   // Corrected from 'font-weight'
            lineHeight: "normal" // Corrected from 'line-height'
        }}
      />
    </div>
  );
}

export default AssetSearchBar;
